import React from 'react';
import styled from 'styled-components';


const Container = styled.body`
    background-color: #282c34;
    width: 100%;
    height: 100px;
    text-align: center;
    justify-content: center;
`

const H1 = styled.h1`
    color: white;
    margin: 0 auto;
`

export default class NavBar extends React.Component {
    render() {
      return (
          <Container>
            <H1>Dashboard</H1>
          </Container>
      )
    }
}
